The California Energy Commission (CEC) Electric Transmission Line geospatial data layer has been created to display the electric transmission grid in California. When used in association with the CEC Power Plant and CEC Electric Substation geospatial data layers, viewers can analyze the geographic relationships with the electric transmision grids across utilities, counties and state.

The transmission line data, as one of the CEC's critical infrastructure spatial data will be used to: 

1. Support the CEC/STEP/Strategic Transmission Planning and Corridor Designation Office in corrdior study and transmission line siting; 

2. Support the CEC staffs various analysis by providing general geographic reference information; 

3. Enhance communication between and among government agencies on emergecy management, resource management, economic development, and environmental study;

4. Provide illustration of critical infrastructure spatial data to the public or other agencies in hardcopy format.
